import React from "react";
import image1 from './Main_info/image/LWL_Campus_2020.png'
import "./App.css";
import {Container} from "reactstrap";
import {Row, Col} from "reactstrap";


const App = () => (
    <div className="w-responsive text-center  p-3 mt-2">
        <Container>
            <Row>
                <Col>
                    <img className="profile-pic" src={image1}/>
                </Col>
            </Row>
        </Container>
    </div>
);




export default App;
